import React from 'react'
import axios from 'axios';
import './Register.css'
import bk from './images/background.svg'

const Register = () => {
    const state = {
      name: '',
    }
    const handleChange = event => {
      this.setState({ name: event.target.value });
    }
    const handleSubmit = event => {
    event.preventDefault();
    }
    const user= {
      name: this.state.name
    };
    return (
      <div className="login">
        <img src={bk} className="bk_img"/>
        <div className="field">
          <p className="field__label">MathBattle</p>
          <p className="field__enter_p">Регистрация</p>
          <form onSubmit={this.handleSubmit}>
            <div className="form__nickname">
                <input className="form__nickname_p" name="Никнейм" onchange={this.handleChange}/>
            </div>
            <div className="form__name">
                <input className="form__nickname_p" name="Имя" onchange={this.handleChange}/>
            </div>
            <div className="form__surname">
                <input className="form__nickname_p" name="Фамилия" onchange={this.handleChange}/>
            </div>
            <div className="form__password">
                <input className="form__password_p" value="Пароль" onchange={this.handleChange}/>
            </div>
            <button type="submit" className="form_submit form_submit_p">Создать</button>
          </form>
        </div>
      </div>
    );
}

export default Register;
